contract TestFallback {
    event Log(string tag, address indexed addr, address indexed sender, uint256 indexed value);

    fallback() external payable {
        emit Log("fallback", address(this), msg.sender, msg.value);
    }

    receive() external payable{
        emit Log("receive", address(this), address(msg.sender), msg.value);
    }
}
